using Microsoft.AspNetCore.Identity;
using Microsoft.EntityFrameworkCore;
using NuGet.Packaging;
using Reservator.Data;
using Reservator.Models;
using System.Security.Cryptography.X509Certificates;

namespace Reservator.Services
{
    public class DataBaseSeeder : IDataBaseSeeder
    {
        private readonly ApplicationDbContext dbContext;
        private readonly UserManager<AppUser> userManager;
        private readonly RoleManager<IdentityRole> roleManager;

        public DataBaseSeeder(ApplicationDbContext dbContext, UserManager<AppUser> userManager, RoleManager<IdentityRole> roleManager)
        {
            this.dbContext = dbContext;
            this.userManager = userManager;
            this.roleManager = roleManager;
        }

        public async Task<bool> HasAnyDataInDBAsync() =>
                   await roleManager.Roles.AnyAsync();

        public async Task InsertDataInDBAsync()
        {
            await this.CreateRolesAsync();
            await this.RegisterUsersAsync();
            await this.CreateRestaurantsAsync();
            await this.CreatePlacesAsync();
            await this.CreateReservationAsync();
        }

        private async Task CreateRolesAsync()
        {
            await roleManager.CreateAsync(new IdentityRole("Admin"));//.GetAwaiter().GetResult();
            await roleManager.CreateAsync(new IdentityRole("Waiter"));
        }

        private async Task RegisterUsersAsync()
        {
            var user1 = new AppUser
            {
                UserName = "Administrator",
                Email = "admin@gmail.com",
                EGN = "Mnogo e dobre"
            };

            var user2 = new AppUser
            {
                UserName = "SimpleUser",
                Email = "ginio_prostiq@abv.bg",
                EGN = "Ne e mnogo dobre"
            };
            var pwd = "1234Aa%";

            await userManager.CreateAsync(user1, pwd);
            await userManager.CreateAsync(user2, pwd);
            await userManager.AddToRoleAsync(user1, "Admin");
        }

        private async Task CreateRestaurantsAsync()
        {
            var restaurant1 = new Restaurant
            {
                Name = "Chiflika",
                Address = "Strandja sakar 12",
                MainPic = "https://business-europe.bg/images/business/mehana-chiflika-front.gif",
                Pictures = "data:image/jpeg;base64,|data:image/jpeg;base64,|https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS3chyMNZYdsSZkBV7-U3LvHA_-GZk5YB4kTQ&usqp=CAU",
                Rating = 4,
                Town = Town.Varna
            };
            await dbContext.AddAsync(restaurant1);
            await dbContext.SaveChangesAsync();

        }

        private async Task CreatePlacesAsync()
        {
            var restorauntFD = dbContext.Restaurants.FirstOrDefault();

            var places = new Place[] {
            new Place()
            {
               Restaurant=restorauntFD,
                Location ="Do prozoreca",
                MainPic  ="data:image/jpeg;base64,",
                Pictures ="https://vipoferta.bg/files/alfarizortchiflika_164939944658564.jpg|https://static.izgodni.bg/ioffers/2021/04/27/b_533801.jpg",
                Seats=4
        },
                        new Place()
            {
                        RestaurantId=restorauntFD.Id,
                Location ="Na vtoriq etaj",
                MainPic  ="data:image/jpeg;base64,",
                Pictures ="https://vipoferta.bg/files/alfarizortchiflika_164939944658564.jpg|https://static.izgodni.bg/ioffers/2021/04/27/b_533801.jpg",
                Seats=6
        }

            };


            //   restorauntFD.Places.AddRange(places);
            await dbContext.AddRangeAsync(places);
            await dbContext.SaveChangesAsync();

        }


        private async Task CreateReservationAsync()
        {
            AppUser userFD = userManager.Users.OrderBy(x => x.Id).Last();//TODO

            Place placeFD = dbContext.Places.OrderBy(x => x.Id).Last();
            var time = new DateTime(2022, 12, 23, 17, 45, 0);
            var reservation = new Reservation()
            {
                UserId = userFD.Id,
                PlaceId = placeFD.Id,
                Time = time,
            };

            await dbContext.AddAsync(reservation);
            await dbContext.SaveChangesAsync();
        }
    }


    public interface IDataBaseSeeder
    {
        Task<bool> HasAnyDataInDBAsync();
        Task InsertDataInDBAsync();
    }
}
